import { Company } from '../../Entitis.type';
import { useState, useEffect,useContext } from 'react';
import {UserContext} from '../../contexts/AppContext';
type Props = {
  token: string
};
const GetAllCustomers = (props: Props) => {
   const {type} = useContext(UserContext);
  // //context.type
  const [company, setCompany] = useState<Array<Company>>([]);
  console.log(props.token);
  useEffect(() => {
    fetch('http://localhost:8080/admin/customers/all', {
      method: 'GET',
      headers: {
        'Authorization': props.token,
        'Content-Type': 'application/json',
      },
      mode: 'cors'
    }).then((res) => res.json()).then((data) => {
      setCompany(data)
      console.log(data); // log response data to console
    }).catch((error) => console.log(error));
  }, []); // add empty array to run useEffect only once on component mount

  return (
    <div className='getAllCompanys'>{
      company.map((companys) => {
          return (
            <>
              <tr key={companys.id} className='coupon'></tr><br />
              <td>{companys.name}</td><br />
              <td>{companys.coupons.map((coupons) => {
                return (
                  <>
                    <td>{coupons.category}</td><br />
                    <td>{coupons.price}</td><br />
                  </>
                )
              })}</td>
            </>
          )
        })}
    </div>

  )
}

export default GetAllCustomers;
